import React from 'react';
import './ColorBox.css';

export default function ColorBox(props) {
  return (
    <div
      style={{ background: props.background }}
      className="ColorBox"
      id={ props.id }
    >
      <span>{ props.name }</span>
      <span>MORE</span>
    </div>
  );
}
